def _clean_google_link(link):

    if '/url?' in link:

        parsed_link = urlparse(link)

        query_params = parse_qs(parsed_link.query)

        url_params = query_params.get('q', []) or query_params.get('url', [])

        if url_params:

            return url_params[0]

    return link
